create table store_daily_incomes
(
    id                                       int unsigned auto_increment
        primary key,
    store_id                                 int unsigned                       not null comment '店铺ID',
    income_in_cents                          bigint unsigned                    not null comment '店铺业绩',
    normal_product_income_in_cents           bigint unsigned                    not null comment '平价区业绩',
    activity_product_income_in_cents         bigint unsigned                    not null comment '活动专区业绩',
    redemption_product_income_in_cents       bigint unsigned                    not null comment '复购区业绩',
    sales_amount_in_cents                    bigint unsigned                    not null comment '店铺销售额',
    normal_product_sales_amount_in_cents     bigint unsigned                    not null comment '平价区销售额',
    activity_product_sales_amount_in_cents   bigint unsigned                    not null comment '活动专区销售额',
    redemption_product_sales_amount_in_cents bigint unsigned                    not null comment '复购区销售额',
    summary_date                             datetime                           not null comment '统计区间（按天统计，记录为当天的0时0分0秒）',
    created_at                               datetime default CURRENT_TIMESTAMP not null,
    updated_at                               datetime                           null,
    deleted_at                               datetime                           null
)
    collate = utf8mb4_unicode_ci;

create index store_daily_incomes_store_id_index
    on store_daily_incomes (store_id);

